import {gql} from 'apollo-server-express';

const typeDefs = gql`

type Author {
  id: Int!
  firstName: String
  lastName: String
  posts: [Post]
}

type Post {
  id: Int!
  title: String
  authorId: String
  votes: Int
}

input PostData {
  id: Int!
  title: String
  authorId: String
  votes: Int
}

type Response {
  success: Boolean
}

type Query {

  posts: [Post]
  author(id: Int!): Author
}

type Mutation {
  createPost(post: PostData): Response
}
`;

export default typeDefs;

